import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function App() {
  return (
    <div className="App">
      <div className="Header">
        <p className="TextHeader">DCRP</p>
      </div>
      <FontAwesomeIcon icon= {['fab', 'github']} size="3x"/>
      <FontAwesomeIcon icon= {['fab', 'linkedin']} size="3x"/>
    </div>
  );
}

export default App;
